> 
> ) ENGINE = ODBC COMMENT "COMMON_InvoiceType" PROPERTIES ("odbc_catalog_resource" = "sqlserver_odbc_xxx", "database" = "ddd", "table" = "bbbb", "ClientCharset" = "UTF-8" );

我试过这个方式，然后使用SHOW CREATE TABLE ext_PortraitConfigTag;
结果发现PROPERTIES中没有"ClientCharset" = "UTF-8"这一项，说明建表语句不支持该属性。
相反的SHOW RESOURCES中就有该属性。
